INSERT INTO `faq` (`id`, `question`, `answer`, `status`, `date`, `time`) VALUES
(23, 'Why to join DigiCoders Technologies?', '<p>The DigiCoders Technologies provides following unique features that attracts you to join-</p><ul><li>Training will be provided by the number 1 consultant of UP.</li><li>We provide training at low cost in a natural, healthy and secure environment.</li><li>Training will be provided by technocrats that have experience of MNC companies.</li><li>Every student will work on live projects.</li><li>All lectures will be 100% practical based.</li><li>Trainees will be given Practical Assignments and Daily Tasks which will help them in enhancing their Skills.</li><li><li>Recovery classes are also available so that students can clear their doubts and get more expertise.</li><li>Regular tests are conducted for the students to rate their skills on different subjects.</li><li>HR &amp; personality development classes are available.<br></li></li></ul>', 'true', '2022-03-10', '05:28:56PM'),
(24, ' What is Winter Training?', '<p>&nbsp;Winter training is a training that held on December - January for a short period of 30-40 days. The purpose of this training program is to train the engineering students in a gap period of two semesters.</p><p><span style=\"font-weight: var(--bs-body-font-weight); text-align: var(--bs-body-text-align);\">&nbsp;In this training we train the students in UI Technologies like as AngularJS, jQuery, JavaScript, BootStrap, HTML &amp; CSS with a live project. Any engineering student of Diploma(CS/IT), B.Tech(CS/IT),BCA, MCA, PGDCA, PGDWD can join this training program.</span></p>', 'true', '2022-03-10', '05:31:13PM'),
(25, 'What is Vocational Training?', '<p><span style=\"font-weight: var(--bs-body-font-weight); text-align: var(--bs-body-text-align);\">Vocational training is education that prepares people to work in various jobs, such as a programmer, a DBA, or as a technocrat. DigiCoders offers unique Vocational training program with latest technologies for selected students of Diploma (CS/IT), PGDCA, PGDWD started in the month of June. During this training students will learn lot of technologies and creates a live project. Duration of this training program in 45 to 60 days.</span><br></p>', 'true', '2022-03-10', '06:23:03PM'),
(26, 'What is Summer Training?', '<p><span style=\"font-weight: var(--bs-body-font-weight); text-align: var(--bs-body-text-align);\">Summer training programs provide great opportunity for engineering students to utilize their summer vacation in the right way. We provide best quality summer training on latest technologies for selected students of B.Tech (CS/IT/EC), BCA, MCA in the month of June &amp; July. During this training students can learn .NET(ASP.NET or MVC)/ Java(Core+Advance)/ PHP/ Python/ Android/ Angular and will create a real time project. Duration of this training program in 45 to 60 days.</span><br></p>', 'true', '2022-03-10', '05:33:45PM'),
(27, 'What is Apprenticeship?', '<p>Apprenticeship is a combination of on-the-job training (OJT) and related classroom instruction under the supervision of a journey-level craft person or trade professional in which students learn the practical and theoretical aspects of a highly skilled occupation. DigiCoders provides best Apprenticeship training that makes you 100% Employable. Pass out and selected students of Diploma(CS/IT) / B.Tech (CS/IT) / BCA / MCA can join this training program. This training program starts in the month of July - August. We promise that we will provide genuine placements to all students. During this training students will learn .NET(ASP.NET and MVC)/ Java(Core+Advanced)/ PHP/ Python/ Android/ JavaScript/ Jquery/ Angular and will create two real time projects.<br></p>', 'true', '2022-03-10', '06:22:04PM'),
(28, 'In which technology I can join training in DigiCoders?', '<p>You can learn any technology according to your interest. DigiCoders offers .NET(ASP.NET and MVC), Java (Core+Advance), PHP, Python, Android, Angular, Oracle, MSSQL, MySQL, HTML, CSS, JavaScript, jQuery, Angular, C, C++, C#, Data Science, IOT, Digital Marketing etc.<br></p>', 'true', '2022-03-10', '06:21:47PM'),
(29, 'Can I get any confirmation after registration?', '<p>Yes; you will get a fee receipt and message in your mobile and email. During online registration when you will pay registration fees then fee receipt will be generated. You have to save or print that receipt. We will also send confirmation message in your mobile and email.<br></p>', 'true', '2022-03-10', '05:38:13PM'),
(30, 'When I will get the certificate?', '<p>After successful evaluation of related projects/assignments &amp; Training completion, you shall be awarded&nbsp; certification from DigiCoders Technology Pvt.Ltd.<br></p>', 'true', '2022-03-10', '05:39:26PM'),
(31, 'Can I pay fee in installments?', '<p>Yes. Installment Details will be provided to you when requested.<br></p>', 'true', '2022-03-10', '05:39:50PM'),
(32, 'How about the internet facility ?', '<p>All the institute are Wi-Fi connected. Apart from that, we have the Computer Centre. Wireless LANs through Wi-Fi are available round the company.<br></p>', 'true', '2022-03-10', '05:41:05PM'),
(33, 'Is the course theoretical or practical?', '<p>Our training will be a combination of theoretical and practical on each topic. We also provide live exposure on projects and give assignments to test your skill sets.<br></p>', 'true', '2022-03-10', '05:41:25PM'),
(34, 'If I do training, what is the use for me?', '<p>First of all you have to understand that Software development is a Engineering strategy to develop software for company/services in online. After learning software development you can start the following</p><ul><li>Get a job in Software industry</li><li>Develop your own Software</li><li>If you are entrepreneur/businessman, you can develop and grow your business with Software Development.</li><li>Better job opportunities and salary hike for experience professionals.</li></ul>', 'true', '2022-03-10', '06:23:18PM');
