INSERT INTO `manage_videos` (`id`, `author_id`, `count`, `video_type`, `image`, `title`, `url`, `short_desc`, `description`, `date`) VALUES
(1, '2', '25', 'Recommended Videos', '2cc553f4857b5b545e113fc1021f8797_manage_videos.jpg', 'Are you a Polytechnic Student? Watch this | Syllabus Oriented Training | DigiCoders Technologies', 'https://www.youtube.com/watch?v=nSROzQd7RVU', '#TeamDigiCoders #SummerTraining #codersadda  Hello Students, Are you a Polytechnic Students?', '<p>There is a good news for polytechnic students, Team DigiCoders is going to start a Syllabus Oriented Training Program, this training program is for Second Year and Third Year students.</p><p><br></p><p>We will provide following subjects classes in this program -&nbsp;</p><p>(only for Computer Science &amp; Information Technology Students)</p><p><br></p><p>1. Internet &amp; Web Technology (Third Semester)</p><p>2. Data Structure using C (Third Semester)</p><p><br></p><p>3. Web Development Using PHP (Fifth Semester)</p><p>4. Computer Programming using Python (Fifth Semester)</p><p>5. Internet of Things (Fifth Semester)</p><p><br></p><p>Benefits You will get in this program -&nbsp;</p><p><br></p><p>1. All Classes Recorded Lectures</p><p>2. Daily 1 Hour Class</p><p>3. Your College Routine will not disturb in this Program</p><p>4. Classes for theory and practical</p><p>5. Regular Excersie and Assignements</p><p>6. Notes PDF in Hindi and English</p><p>7. Every Sunday Special classes on different topics</p><p>8. Doubt solving support 24/7</p><p>9. Assesment Test will organize on regular basis</p><p>10. Important question preparation for exams</p><p>11. Special classes before 1 day of exams</p><p>12. Revision/Recovery Classes</p><p><br></p><p>Batch Starting from 17th Oct 2022</p><p><br></p><p>Fees will be - 249/- (Per Subject)</p><p>(?? ???????? ????????? ??? ???? ?????? ?? ?????? ?? ???? ??? ??? ????? ???? ??? ?? ??????????? ?? ????????? ?????? ???? ???)</p><p><br></p><p>3 Classes available without any Fees</p><p><br></p><p>????? ??? ?????? ?? ??? ???? ??? ??? WhatsApp ????? ??? ???? ?? ????? ???? ???? ???? -</p><p><br></p><p>Second Year (Third Semester Students)</p><p>https://chat.whatsapp.com/EeP2rqQXOWq3S7OhTmO0qz</p><p><br></p><p>Third Year (Fifth Semester Students)</p><p>https://chat.whatsapp.com/FTVw2y9RpVj5rkSL3wS0GX</p><p><br></p><p>-----------------------------------------------------------------------------------------------------------------</p><p><br></p><p>Registration Link: https://thedigicoders.com/Home/Registration</p><p><br></p><p>About DigiCoders :</p><p>DigiCoders Technologies Best Software Training Company in Lucknow. We Leading by young software Engineers and Entrepreneurs. Software Company today operates on many different business model and provide a wide array of products and services. A software Company to become faster and more productive for the customer than ever. DigiCoders Technologies Best software development company in Lucknow. At DigiCoders we have world\'s top developer of enterprise solution commonly known as an infrastructure as a services (IaaS) with SaaS powering many IaaS solutions. We Provide the best Software services like Software development Website Development, Mobile Application Development, Digital Marketing, and Training Programs.</p><p><br></p><p>Contact Us at: https://thedigicoders.com/Home/Contact</p><p><br></p><p>Copyright Disclaimer :</p><p>Under Section 107 of the Copyright Act 1976, allowance is made for \"fair use\" for purposes such as criticism, comment, news reporting, teaching, scholarship, and research. Fair use is a use permitted by copyright statute that might otherwise be infringing. Non-profit, educational or personal use tips the balance in favour of fair use.</p>', '2023-04-25');
